description:
CD 1: St Petersburgs Boys Choir sing songs by Russian and European composers.
      An excellent performance of Vocalis is included

CD 2: Stas Mikhalevich is the wonderful treble soloist of this album. A great    
      performance of Lascia chio pianga and O sole mio is included

MP3
ABR 256 kb/s

Enjoy!

